import React from "react";
import { Link, NavLink } from "react-router-dom";
import NavigationSection from "./navigation/NavigationSection";
import NavigationHeader from "./navigation/NavigationHeader";
import NavigationItem from "./navigation/NavigationItem";

class Navigation extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.state = {
      open: true
    };
  }

  handleSelect(activeKey) {
    console.log("Activedd key is: ", activeKey);
    this.setState({ activeKey });
  }

  render() {
    //console.log("ACTIVE KEY IS: ", this.state.activeKey);
    return (
      <div className="sidenav">
        <NavigationSection>
          <NavigationHeader url="/" name="Home"/>
        </NavigationSection>
        <NavigationSection>
          <NavigationHeader url="/creative" name="Creative"/>
          <NavigationItem url="/creative/chord-art" name="Chord Art"/>
        </NavigationSection>
        <NavigationSection>
          <NavigationHeader url="/generative" name="Generative"/>
        </NavigationSection>
        <NavigationSection>
          <NavigationHeader url="/repetitive" name="Repetitive"/>

        </NavigationSection>
      </div>
    );
  }
}


export default Navigation;
